import styled from "styled-components";

export const Container = styled.div`
  position: absolute;
  top: 0;
  height: 100%;
  transition: all 0.6s ease-in-out;
  left: 0;
  width: 50%;
  z-index: 2;

  .social-container {
    margin: 20px 0;
  }
`;
